import logo from './logo.svg';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { AppBar, Box, Divider, Grid, IconButton, Stack, Tab, Tabs, Typography } from '@mui/material';
import CssBaseline from '@mui/material/CssBaseline';
import FilterVintageIcon from '@mui/icons-material/FilterVintage';
import './App.css';
import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import MailIcon from '@mui/icons-material/Mail';
import { styled } from '@mui/system';

function WavyDivider() {
  return (
    <Box
      sx={{
        width: '100%',
        height: '20px',  // Slightly increased height for more pronounced waves
        overflow: 'hidden',
        lineHeight: 0,
        marginTop: '20px',
        marginBottom: '20px',
      }}
    >
      <svg
        viewBox="0 0 1200 30"  // Adjusted viewBox for more waves and higher peaks
        preserveAspectRatio="none"
        style={{
          width: '100%',
          height: '100%',
          fill: 'none',         // No fill for the wave
          stroke: '#b4bb73',    // The color of the wave
          strokeWidth: 2,       // Adjust the stroke thickness
        }}
      >
        <path
          d="M0,15 C30,5 60,25 90,15 C120,5 150,25 180,15 C210,5 240,25 270,15 C300,5 330,25 360,15 C390,5 420,25 450,15 C480,5 510,25 540,15 C570,5 600,25 630,15 C660,5 690,25 720,15 C750,5 780,25 810,15 C840,5 870,25 900,15 C930,5 960,25 990,15 C1020,5 1050,25 1080,15 C1110,5 1140,25 1170,15 C1200,5 1230,25 1260,15"
        />
      </svg>
    </Box>
  );
}



function App() {
    const theme = createTheme({
        palette: {
            primary: {
              main:  '#da8129',
              dark: '#ffffff',
              light: '#ffffff',
              contrastText: 'rgba(0,0,0,0.87)',
            },
            secondary: {
              main: '#FD9584',
            },
            third: {
              main: '#b4bb73'
            },
            background: {
              paper: '#ffffff',
              default: '#fff6ec',
            },
        },
        components: {
            MuiTab: {
                styleOverrides: {
                    root: {
                        color: '#da8129', // Customize text color
                        textTransform: 'lowercase',
                        fontFamily: [
                            '-apple-system',
                            'BlinkMacSystemFont',
                            '"Segoe UI"',
                            'Roboto',
                            '"Helvetica Neue"',
                            'Arial',
                            'sans-serif',
                            '"Apple Color Emoji"',
                            '"Segoe UI Emoji"',
                            '"Segoe UI Symbol"',
                        ].join(','),
                        '&.Mui-selected': {
                            color: '#da8129', // Customize selected tab text color
                            borderBottom: '2px solid transparent', // Base border
                            backgroundImage: `url('data:image/svg+xml;utf8,<svg xmlns="http://www.w3.org/2000/svg" width="100" height="10"><path d="M0 5 C 10 0, 20 10, 30 5, 40 0, 50 10, 60 5, 70 0, 80 10, 90 5, 100 0" stroke="%23b4bb73" fill="transparent" stroke-width="2"/></svg>')`,
                            backgroundRepeat: 'no-repeat',
                            backgroundPosition: 'bottom center',
                            backgroundSize: 'contain',
                        },
                    },
                },
            },
            MuiTypography: {
                styleOverrides: {
                    root: {
                        fontFamily: [
                            '-apple-system',
                            'BlinkMacSystemFont',
                            '"Segoe UI"',
                            'Roboto',
                            '"Helvetica Neue"',
                            'Arial',
                            'sans-serif',
                            '"Apple Color Emoji"',
                            '"Segoe UI Emoji"',
                            '"Segoe UI Symbol"',
                        ].join(',')
                    }
                }
            },
            MuiDivider: {
                styleOverrides: {
                    root: {
                        color: '#da8129'
                    }
                }
            }
        }
    })

    return (
        <ThemeProvider theme={theme}>
            <CssBaseline />
            <Stack alignItems="center" direction="row" sx={{display: 'flex', width: '100%'}}>
                <Grid container>
                    <Grid item xs={8} sx={{pl:1}}>
                        <Stack alignItems="center" direction="row" >
                            <FilterVintageIcon sx={{mt:2.5, ml:1, color: '#b4bb73'}} />
                            <Typography sx={{alignContent: 'center', pl: 1, pt:2, fontFamily: "Berkshire Swash"}} variant='h4' color="primary.main"> Sega Birhane</Typography>
                            <FilterVintageIcon sx={{mt:2.5, ml:1, color: '#b4bb73'}} />
                        </Stack>
                    </Grid>
                    <Grid item xs={4}>
                        <Tabs
                            sx={{
                                '& .MuiTabs-indicator': {
                                    display: 'none', // This hides the default underline
                                },
                                justifyContent: 'flex-end',
                                alignItems: 'flex-end',
                                mt:1,
                            }}
                            value={0}
                        >
                            <Tab  label="About Me"/>
                            <Tab  label="projects"/>
                            <Tab  label="resume"/>
                            <Tab  label="contact me"/>
                        </Tabs>
                    </Grid>
                </Grid>
             </Stack>
             <Grid container sx={{mt:8}} >
                <Grid item sx={{display: 'flex', alignContent: 'center', justifyContent: 'left', pl:6}} lg={4} md={5} sm={8}>
                        <Box sx={{width: '350px', height: "475px", border: '15px solid #Cdd9C5' }}>
                            <img style={{border: '15px solid #D9CCE0'}} width="350" height="475" src="ProfilePic.JPG"/>
                        </Box>
                </Grid>
                <Grid item sx={{display: 'flex', alignContent: 'center', justifyContent: 'center', pr:2}} lg={8} md={7} sm={4}>
                    <Stack spacing={2}>
                        <Typography
                            variant="h4"
                            sx={{fontWeight: 'bold'}}
                            align="center"
                            color="secondary"
                        >
                            Full stack developer creating beautiful products with technical rigor and user empathy.
                        </Typography>
                        <Typography
                            variant="h6"
                            color="primary.main"
                        >
                        Hello, I’m Yeabtsega Birhane—you can call me Sega. I’m currently a contract Software Engineer at <a href="https://www.movementhealthscience.com/" style={{color:'#b4bb73'}} target="_blank">Movement Health Science</a>.
                        <br />
                        <br />
                        I have over three years of experience as a Full Stack Engineer, working with: React, Vue, CSS, JavaScript, Django, and Python. I graduated from <a href="https://www.hmc.edu/" style={{color:'#b4bb73'}} target="_blank">Harvey Mudd College</a> in 2020 with a degree in Computer Science and Math.
                        <br />
                        <br />
                        Feel free to check out my resume [here], my projects[here], and don’t hesitate to reach out via email with any questions or inquiries.

                        </Typography>
